import "bootstrap/dist/css/bootstrap.min.css";
import './App.css';
import { Routes, Route, Link } from 'react-router-dom'
import Dashboard from "./components/Dashboard";

function App() {
  return (
    <div className="App">
      <Dashboard />
      <Routes>
        <Route path="/" element={<Dashboard />} />
      </Routes>
    </div>
  );
}

export default App;
